import React, { Component } from 'react';

export default class Account extends Component{

    constructor(login){
        super(login);
        this.state = {
            js: []
        }
    }

    #getAccount = async () => {
        try {
            const response = await fetch("http://localhost:4000/search/8");
            const jsonData = await response.json();

            
            const dt = Object.values(jsonData);
            this.setState({js: dt})
            return dt;

        } catch (error) {
            console.error(error);
        }
    };


    render(){
        const dt = this.#getAccount();
        console.log("return: ", dt);
        console.log("js:", this.state.js);
        return<div>hi</div>;
    }
}
